import React from 'react'

const Privacy1 = () => {

    return (
        <div>
            <section className="upcoming-events" style={{backgroundColor:'#fff', color:'white',padding:'10px', textAlign:'center'}}>
                <h2 className="privacy-policy">Privacy Policy</h2>
                <div className="event-container">
                </div>
            </section>

        </div>
    )
}

export default Privacy1
